import React,{ useState } from 'react'
export default function About(props){

    const [count,setCount] = useState(0);   
    
    return (
        <div className="row mt-5">
            <p>
            <button onClick={() => setCount(count+1)}>
                Click me
            </button>
            </p>
        </div>
    );
}
